import React from "react";
import { Modal, Form, DataPicker, DatePicker } from "antd";
const CustomModal = ({ visible, handleOk, handleClose, editableData }) => {
  return (
    <Modal visible={visible} onOk={handleOk} onCancel={handleClose}>
      <Form>
        <Form.Item>
          <DatePicker showTime onOk={false} />
        </Form.Item>
      </Form>
    </Modal>
  );
};

export default CustomModal;
